import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from "react";

const LVariables = {
    userNameState: useState(""),
    passwordState: useState(""),
    newUserNameState: useState(""),
    newPasswordState: useState("")
};

LVariables.setUserName = LVariables.userNameState[1];
LVariables.setPassword = LVariables.passwordState[1];
LVariables.setNewUserName = LVariables.newUserNameState[1];
LVariables.setNewPassword = LVariables.newPasswordState[1];

export default LVariables;
